    async Task SaveRow(Producto order)
    {
        total = order.Cantidad * order.PrecioVenta;
        order.Total = total;
        await grid.UpdateRow(order);
        TotalFacturar = 0;
        foreach (var item in lstProd)
        {
            TotalFacturar += item.Total;
        }
        calculo();
